import React, { Component } from "react";
import "../css/ToDoList.css";

const ToDoList = () => {
  let items = [];
  items.push(
    <div>
      <text>item1</text>
    </div>
  );
  return (
    <div className="to-do-list-container">
      <input />
      <button>submit</button>
      <div>
        <text>item 1</text>
        <button>remove</button>
      </div>
    </div>
  );
};

export default ToDoList;
